import axios from "axios";
import { url } from "inspector";
import { useEffect, useState } from "react";
import Pagination from "react-js-pagination";
import { IQuestion } from "./types";

import QuestionNote from "./QuestionNote";

export interface Props {
	questionList: IQuestion[];
}

function QuestionNoteList(props: Props) {
	function blah() {
		const tapeList = ["tape1.svg", "tape2.svg"];
		const chosenTape = tapeList[Math.floor(Math.random()) * tapeList.length];
		// img 태그 동적 삽입
		const tapeImage = document.createElement("img");

		tapeImage.src = `../masking-tapes/${chosenTape}`;
		tapeImage.className = "QuestionNote-maskingTape-img";

		var tapeBoxes = document.getElementsByClassName(
			"QuestionNote-maskingTape-box"
		);
		var tapeBoxList = Array.from(tapeBoxes);
		tapeBoxList.forEach((box) => {
			box.appendChild(tapeImage);
		});
	}
	blah();
	return (
		<>
			<div className="question-notes-container">
				{props.questionList.map((question, idx) => (
					<QuestionNote key={idx} idx={idx} question={question} />
				))}
			</div>
		</>
	);
}

export default QuestionNoteList;
